import React from "react";
import classes from "./Button.module.css";

const Button = ({ type, onClick, children }) => {
  return (
    <button
      className={classes.button}
      type={type || "button"}
      onClick={onClick}
    >
      {children}
    </button>
  );
};

export default Button;
